import React from 'react';
import './TechSpecsSection.css';

function TechSpecsSection() {
  return (
    <section className="tech-specs-section">
      <h2>Technical Specifications</h2>
      <ul className="specs-list">
        <li><strong>Algorithm:</strong> Uses GPT-4 for natural language processing</li>
        <li><strong>System Requirements:</strong> Runs on Windows, macOS, and Linux</li>
        <li><strong>Integration:</strong> Easily integrates with existing CRM systems</li>
        {/* Add more technical specs as needed */}
      </ul>
    </section>
  );
}

export default TechSpecsSection;
